INSERT INTO `email_templates` (`id`, `name`, `subject`, `description`, `created_at`, `updated_at`) VALUES
(5, 'Template 1', 'Thank you for completing the questionnaire!', '<p class=\"MsoNormal\"><span style=\"font-size:13.5pt;font-family:&quot;Georgia&quot;,&quot;serif&quot;\">What\'s\r\nnext:</span></p><p class=\"MsoNormal\"><span style=\"font-family: Georgia, serif; font-size: 13.5pt;\">The\r\nnext step is to conduct a 30 minute welcome call.&nbsp; We will make sure we\r\nhave all the right contact information for you.&nbsp; Additionally, we will\r\nreview the information in the questionnaire and we may ask some follow&nbsp;up\r\nquestions.</span></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p><span style=\"font-family: Georgia, serif; font-size: 13.5pt;\">What\'s\r\ngood time tomorrow for you to set aside 30 minutes for a zoom call?&nbsp;&nbsp;</span></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p><span style=\"font-family: Georgia, serif; font-size: 13.5pt;\">I\r\nhave open availability until 1pm EST.</span></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p><span style=\"font-family: Georgia, serif; font-size: 13.5pt;\">Simply\r\nreply to this email with any questions.</span></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><o:p><br></o:p><span style=\"font-family: Georgia, serif; font-size: 13.5pt;\">Warm\r\nregards</span></p>', '2021-08-12 05:44:19', '2021-08-20 22:27:55'),
(6, 'Link to Materials', '**IMPORTANT RESOURCES** Link to materials and task list.', '<p class=\"MsoNormal\">Hello Real Estate Family...</p><p class=\"MsoNormal\">Please use this link to access all the materials that we\r\ncover in the group meetings.</p><p class=\"MsoNormal\"><a href=\"https://drive.google.com/drive/folders/1xQ-S6FA2diPYvOivecEisLrkr4nhke7x?usp=sharing\" target=\"_blank\">https://drive.google.com/drive/folders/1xQ-S6FA2diPYvOivecEisLrkr4nhke7x?usp=sharing</a></p><p class=\"MsoNormal\">Also - Here is your first task list.&nbsp; &nbsp;You can\r\nemail the finished list to this email address.</p><p class=\"MsoNormal\">You will cover this in your one on one with Odis</p><p style=\"margin-left:47.25pt;mso-line-height-alt:11.2pt\">1.<span style=\"font-size:7.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b>Find\r\nauction dates &amp; requirements for participating in your target city/county.</b><o:p></o:p></p><p style=\"margin-left:47.25pt;mso-line-height-alt:11.2pt\">2.<span style=\"font-size:7.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b>Identify\r\nareas in your target city you’d like to invest in. Choose a zip code.</b><o:p></o:p></p><p style=\"margin-left:47.25pt;mso-line-height-alt:11.2pt\">3.<span style=\"font-size:7.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b>Find\r\nthree Wholesalers in your target city (or state).</b><o:p></o:p></p><p style=\"margin-left:47.25pt;mso-line-height-alt:11.2pt\">4.<span style=\"font-size:7.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b>Find\r\nout what your credit score is.</b><o:p></o:p></p><p style=\"margin-left:47.25pt;mso-line-height-alt:11.2pt\">5.<span style=\"font-size:7.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b>Find\r\na local bank in your target area (Community bank or credit union).</b><o:p></o:p></p><p style=\"margin-left:47.25pt;mso-line-height-alt:11.2pt\">6.<span style=\"font-size:7.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b>Find\r\nfive hard money Lenders for your target city and&nbsp;list&nbsp;their terms.\r\nBased on your current financial situation, which is most favorable.</b><o:p></o:p></p><p style=\"margin-left:47.25pt;mso-line-height-alt:11.2pt\">7.<span style=\"font-size:7.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b>Find\r\nout what Section 8 pays for the different unit types (1,2,3, or 4 bedroom) in\r\nyour target city.</b><o:p></o:p></p><p style=\"margin-left:47.25pt;mso-line-height-alt:11.2pt\">8.<span style=\"font-size:7.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b>Find\r\na Realtor in your target city.</b></p><p style=\"margin-left:47.25pt;mso-line-height-alt:11.2pt\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\">9.</span><span style=\"font-size: 7pt; font-family: &quot;Times New Roman&quot;, serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><b style=\"font-size: 0.875rem;\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">Find a property management company in your\r\ntarget city.</span></b><br></p>', '2021-08-12 05:45:37', '2021-11-29 22:47:10'),
(7, 'Template 3', 'Thanks for attending our workshop.', '<p class=\"MsoNormal\">Hello,<br>\r\nThank you for joining us for the workshop. We have had several people, like\r\nyourself, that indicated they were not sure about being mentored by Odis on the\r\nregistration. A few of those folks have decided to sign up.<br>\r\n<br>\r\nWe actually have a group that starts Wednesday.&nbsp; What we like to do is\r\nhave a 30 minute call prior to joining.&nbsp; This way we can make sure\r\nOdis\'&nbsp;program is a good fit for you.&nbsp; We can also help you decide\r\nwhat the right entry level is for you.</p><p class=\"MsoNormal\">If you are still on the fence or you have already decided to\r\nmake the commitment to yourself:<br>\r\n<br>\r\nPlease click the link below to schedule your 30 minute information call.&nbsp;</p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\"><a href=\"https://calendly.com/letjameshelp/odis-james-mentor-program\" target=\"_blank\">https://calendly.com/letjameshelp/odis-james-mentor-program</a><br>\r\n<br>\r\nLooking forward to talking to you soon!</span><br></p>', '2021-08-12 05:46:19', '2021-08-12 05:46:19'),
(8, 'Template 4', 'Thank you for completing the questionnaire!', '<p class=\"MsoNormal\"><span style=\"font-size:13.5pt;font-family:&quot;Georgia&quot;,&quot;serif&quot;\">What\'s\r\nnext:</span></p><p class=\"MsoNormal\"><span style=\"font-size:13.5pt;font-family:&quot;Georgia&quot;,&quot;serif&quot;\">Odis\r\nand his team will review your specific information.&nbsp;&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"font-size:13.5pt;font-family:&quot;Georgia&quot;,&quot;serif&quot;\">We\r\nwill schedule one on one zoom calls to review this information with you.</span></p><p class=\"MsoNormal\"><span style=\"font-size:13.5pt;font-family:&quot;Georgia&quot;,&quot;serif&quot;\">You\r\nwill receive an email to schedule a zoom&nbsp;meeting.</span></p><p class=\"MsoNormal\"><span style=\"font-size:13.5pt;font-family:&quot;Georgia&quot;,&quot;serif&quot;\">Simply\r\nreply to this email with any questions.</span><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size:13.5pt;font-family:&quot;Georgia&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Warm\r\nregards</span><br></p>', '2021-08-12 05:47:04', '2021-08-12 05:47:04'),
(9, 'Template 5', 'Re: Contractor Info from Clubhouse.', '<p class=\"MsoNormal\">Hello</p><p class=\"MsoNormal\">Here is the list.&nbsp; It\'s part of a lesson that Odis\r\nteaches in the mentor program.&nbsp; If you want more information about the\r\nprogram just let me know and I can give you details.</p><p class=\"MsoNormal\">1.&nbsp; Independent&nbsp;ContractorAgreement<o:p></o:p></p><p class=\"MsoNormal\">2. Scope of Work<o:p></o:p></p><p class=\"MsoNormal\">3. Payment Schedule<o:p></o:p></p><p class=\"MsoNormal\">4. Contractor Insurance indemnification<o:p></o:p></p><p class=\"MsoNormal\">5. W-9 Tax form<o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">6. Final Unconditional Waiver of Lien<o:p></o:p></p>', '2021-08-12 05:47:35', '2021-08-12 05:47:35');
INSERT INTO `email_templates` (`id`, `name`, `subject`, `description`, `created_at`, `updated_at`) VALUES
(10, 'Welcome Email', 'Welcome to the Odis James Real Estate Family', '<p><img src=\"data:image/png;base64,\" style=\"width: 622px;\" data-filename=\"unnamed (1).png\"></p><p><br></p><table border=\"0\" cellpadding=\"5\" width=\"600\" cellspacing=\"5\" height=\"400\" style=\"font-family: arial; font-size: 16px;\"><tbody><tr valign=\"top\" height=\"50\"><td style=\"margin: 0px; font-size: 12pt;\">Congratulations!!</td></tr><tr valign=\"top\" height=\"300\"><td style=\"margin: 0px; font-size: 12pt;\">The road to wealth begins in the mind! That is where our journey begins. I’d like to congratulate you on joining the group of people who are ready to take action on their journey to building wealth.<br><br>I have found that fear becomes the most common barrier for new investors and real estate entrepreneurs. I say to you with absolute confidence that you will be armed with all the knowledge and skills you need to break through that fear. You should feel proud that you took this step.<br><br>Please take a few minutes to fill out a questionnaire that will help me personalize your experience. The link is:&nbsp;<a href=\"https://odis59.wixsite.com/mysite-1/intake-form\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=https://odis59.wixsite.com/mysite-1/intake-form&amp;source=gmail&amp;ust=1637700768863000&amp;usg=AOvVaw3tsDw0sZv7VgMa-WcwcZLW\" style=\"color: rgb(17, 85, 204);\">Intake form</a><br><br>It’s an&nbsp;honor&nbsp;to be your partner on this amazing journey.<br><br>Welcome to the family!<br><div><br></div><div>Respectfully,<br><br>Odis D. James III<br></div></td></tr><tr valign=\"top\" height=\"50\"><td style=\"margin: 0px; font-size: 12pt;\"><div>James Street Capital, LLC<br>Office: 800-780-6597<br><br><a href=\"mailto:info@odisjames.com\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">info@odisjames.com</a><br></div><div><a href=\"http://www.odisjames.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=http://www.odisjames.com/&amp;source=gmail&amp;ust=1637700768863000&amp;usg=AOvVaw1fv8oPYyraLXpwqTDPoXOh\" style=\"color: rgb(17, 85, 204);\">www.odisjames.com</a></div></td></tr></tbody></table>', '2021-11-23 03:53:29', '2021-11-23 03:53:29');
INSERT INTO `events` (`id`, `name`, `image`, `description`, `event_date`, `event_time`, `longitude_latitude`, `address`, `status`, `price`, `created_at`, `updated_at`) VALUES
(9, 'Los Angeles Real Estate Investing Mastermind', '1643917140.jfif', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; color: rgb(111, 114, 135); font-size: 16px; line-height: 1.5rem; font-family: &quot;Neue Plak&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; letter-spacing: 0.5px;\">Our Mastermind is intended to bring individuals with limited knowledge of real estate investing a complete business building solution. We focus on the how to of real estate investing with respect to strategies, best practices and understanding of relevant fundamentals. More importantly, we will piece together the mechanics involved with running a real estate investing business. This includes how to structure your entity to achieve tax favor, liability protection, and anonymity.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 10px 0px 0px; color: rgb(111, 114, 135); font-size: 16px; line-height: 1.5rem; font-family: &quot;Neue Plak&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; letter-spacing: 0.5px;\">Please click this link for a detailed schedule and meeting agenda:</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 10px 0px 0px; color: rgb(111, 114, 135); font-size: 16px; line-height: 1.5rem; font-family: &quot;Neue Plak&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; letter-spacing: 0.5px;\"><a href=\"https://drive.google.com/file/d/1vWLJCxVQPeTzT36TgIR8xqfrJQSw3or_/view?usp=sharing\" target=\"_blank\" rel=\"nofollow noopener noreferrer\" style=\"color: var(--eds-control,#3659e3); cursor: pointer; padding-top: 0px;\">Link to Mastermind Schedule and Meeting Agenda</a></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 10px 0px 0px; color: rgb(111, 114, 135); font-size: 16px; line-height: 1.5rem; font-family: &quot;Neue Plak&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; letter-spacing: 0.5px;\">Masterminds are limited in the number of attendees. We will break halfway through for lunch. Lunch will not be provided.</p>', '2022-04-02', '09:00:00', '34.05035871419512, -118.26036397815513', 'InterContinental Los Angeles Downtown, an IHG Hotel  900 Wilshire Boulevard  Los Angeles, CA 90017', 1, 800, '2022-02-04 02:39:00', '2022-02-04 02:39:00'),
(10, 'Real Estate Mastermind Miami', '1647733795.jpg', '<p data-key=\"15\"><span data-key=\"16\">Our Mastermind is intended to bring individuals with limited knowledge of real estate investing a complete business building solution. We focus on the \"how to\" of real estate investing with respect to strategies, best practices and understanding of relevant fundamentals. More importantly, we will piece together the mechanics involved with running a real estate investing business. This includes how to structure your entity to achieve tax favor, liability protection, and anonymity.&nbsp;</span></p><p data-key=\"17\"><span data-key=\"18\">Please click this link for a detailed schedule and meeting agenda:</span></p><p data-key=\"19\"><span data-key=\"26\"><span data-slate-zero-width=\"z\"></span></span><a data-key=\"20\" href=\"https://drive.google.com/file/d/1bGcq0-KyMJZw3wZAlqdXjChAZK7f8UeX/view?usp=sharing\">Link to Mastermind Schedule and Meeting Agenda</a><span data-key=\"27\"><span data-offset-key=\"27:0\"><span data-slate-zero-width=\"z\"></span></span></span></p><p data-key=\"22\"><span data-key=\"23\">Masterminds are limited in the number of attendees. We will break halfway through for lunch. Lunch will not be provided.</span></p><p data-key=\"24\" data-slate-fragment=\"\"><span data-key=\"25\">*** A registration link will be emailed to attendess approximately 48 hours prior to the event. The email will have a link to the lessons we\'ll be studying at the event.</span></p>', '2022-04-30', '09:00:00', '25.77886492789038, -80.30997284498622', '711 NW 72nd Ave, Miami, FL 33126', 1, 199, '2022-03-20 03:49:55', '2022-03-20 03:49:55');
