INSERT INTO `services` (`id`, `name`, `image`, `description`, `status`, `created_at`, `updated_at`) VALUES
(11, 'Real Estate Invester', '1640884792.png', '<p>As an investor, Odis is well versed in long term hold strategies, rehabs and light construction, flips, creative finance, and creating multiple revenue streams with a single asset. With various strategies in his tool box, Odis is able to create solutions for distressed sellers without compromising the integrity of his brand.<br></p>', 1, '2021-06-16 18:34:42', '2021-12-31 00:19:52'),
(12, 'Entrepreneur', '1640884776.png', '<p>Odis has an acute sense of business. As an entrepreneur, Odis built a company utilized the Outsourcing business model that ultimately generated seven figures. He dovetails his entrepreneurial mind and his real estate investing skillset to gain a competitive advantage.<br></p>', 1, '2021-06-16 18:44:16', '2021-12-31 00:19:36'),
(13, 'Speaker', '1640731723.jpg', '<p>Odis is most comfortable articulating his ideas in front of large crowds. His public speaking journey began in the faith-based community and spilled over into different aspect of his professional career. He has encouraged and motivated individuals in the corporate space, and well as the personal development, and entrepreneurial spaces. Removing doubt and limiting beliefs has been a long-time talent.<br></p>', 1, '2021-06-18 12:42:17', '2021-12-29 05:48:43'),
(14, 'Real Estate Broker', '1640731673.jpg', '<p>Odis was fluent in the language of real estate from an early age. His father, Odis Jr., had been a real estate broker since 1971 and took young Odis with him to the office and client meetings. It did not take long for Odis to pick up his father’s work ethic and love of real estate. In 2003, Odis and his father opened their first office in San Jose, CA, and by 2005 they had added a mortgage brokerage to their list of services. Today Odis is a licensed real estate broker in the states of California, South Carolina (pending), and Georgia (pending).<br></p>', 1, '2021-06-18 12:42:40', '2021-12-29 05:47:53'),
(15, 'Business Consultant', '1640731651.png', '<p>Odis has held regional level positions in some of the largest real estate management companies in the works. Through the implementation of learned best practices, Odis helps small real estate investment businesses understand the systems, and processes necessary to maximize their efficiency, reduce unnecessary liability, and increase their bottom line. With the help of small business consultant and long time friend James Lewis, Odis incorporates a business consulting component to his mentorship program.<br></p>', 1, '2021-06-18 12:43:04', '2021-12-29 05:47:31'),
(16, 'Multi Family', '1640731602.jpg', '<p>As a Regional Manager for some of the largest multifamily organizations in the world, Odis is well versed in the operations of large multifamily assets. At the height of his multifamily career Odis was responsible for overseeing in excess of $500 million in multifamily real estate in the San Francisco Bay Area.<br></p>', 1, '2021-06-18 12:43:18', '2021-12-29 05:46:42');
